var title_f0_6_105="OSA symptoms questionnaire";
var content_f0_6_105=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F81751%7EPULM%2F59695&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F81751%7EPULM%2F59695&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Questionnaire for exploring obstructive sleep apnea (OSA) symptoms",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Questions",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Circle one",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        People tell me that I snore",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I wake up at night with a feeling of shortness of breath or choking",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        People tell me that I gasp, choke, or snort while I am sleeping",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        People tell me that I stop breathing while I am sleeping",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I awake feeling almost as or more tired than when I went to bed",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I often awake with a headache",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I often have difficulty breathing through my nose",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I fight sleepiness during the day",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I fall asleep when I relax before or after dinner",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Friends, colleagues, or family comment on my sleepiness",
"       </td>",
"       <td>",
"        Y",
"       </td>",
"       <td>",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_single\">",
"        High risk",
"       </td>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Low risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         - Male",
"        </p>",
"        <p>",
"         - Body mass index greater than 25 kg/m",
"         <sup>",
"          2",
"         </sup>",
"        </p>",
"        - Neck circumference:",
"        <ul>",
"         <li>",
"          Greater than 17 inches in men",
"         </li>",
"         <li>",
"          Greater than 16 inches in women",
"         </li>",
"        </ul>",
"        <p>",
"         - Habitual snoring/gasping noted by bed partner",
"        </p>",
"        <p>",
"         - Hypertension",
"        </p>",
"       </td>",
"       <td colspan=\"2\">",
"        <p>",
"         - No snoring",
"        </p>",
"        <p>",
"         - Premenopausal",
"        </p>",
"        <p>",
"         - Thin",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Associated Professional Sleep Societies, LLC, 2010. Meoli AL, Rosen CL, Kristo D, et al. Upper Airway Management of the adult patient with obstructive sleep apnea in the perioperative period-avoiding complications. Sleep 2003; 26:1060. Copyright &copy; 2003.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Identification and assessment of obstructive sleep apnea (OSA): American Society of Anesthesiologists example",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical signs and symptoms suggesting the possibility of OSA",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        1. Predisposing physical characteristics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        a. Body mass index 35 kg/m",
"        <sup>",
"         2",
"        </sup>",
"        (95th percentile for age and gender)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        b. Neck circumference 17 inches (men) or 16 inches (women)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        c. Craniofacial abnormalities affecting the airway",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        d. Anatomical nasal obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        e. Tonsil nearly touching or touching in the midline",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_single\">",
"        2. History of apparent airway obstruction during sleep (two or more of the following are present: if patient lives alone or sleep is not observed by another person, then only one of the following needs to be present)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        a. Snoring (loud enough to be heard through closed door)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        b. Frequent snoring",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        c. Observed pauses in breathing during sleep",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        d. Awakens from sleep with choking sensation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        e. Frequent arousals from sleep",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        f. (Intermittent vocalization during sleep)*",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_single\">",
"        3. Somnolence (one or more of the following is present)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        a. Frequent somnolence or fatigue despite adequate \"sleep\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        b. Falls asleep easily in a non stimulating environment (eg, watching TV, reading, riding in or driving a car) despite adequate \"sleep\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        c. (Parent or teacher comments that child appears sleepy during the day, is easily distracted, is overly aggressive, or has difficulty concentrating)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        d. (Child often difficult to arouse at usual awakening time)*",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    If a patient has signs or symptoms in&nbsp;two or more of the above categories, there is a significant probability that he or she has obstructive sleep apnea (OSA). The severity of OSA may be determined by sleep study. If a sleep study is not available, such patients should be treated as though they have moderate sleep apnea unless one or more of the signs or symptoms above is severely abnormal (eg, markedly increased body mass index or neck circumference, respiratory pauses that are frightening to the observer, patient regularly falls asleep within minutes after being left unstimulated), in which case they should be treated as though they have severe apnea.",
"    <div class=\"footnotes\">",
"     * Item in parentheses refers to pediatric patients.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: American Society of Anesthesiologists Task Force on Perioperative Management of Patients with Obstructive Sleep Apnea. Practice guidelines for the perioperative management of patients with obstructive sleep apnea: a report by the American Society of Anesthesiologists Task Force on Perioperative Management of Patients with Obstructive Sleep Apnea. Anesthesiology 2006; 104:1081. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
