"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Hypothermia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hypothermia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H175117909\">",
"      <span class=\"h1\">",
"       What is hypothermia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hypothermia is when the body gets very cold and can&rsquo;t warm up on its own. Body temperature is normally around 98.6&ordm;F (37&ordm;C). Hypothermia is when it drops below 95&ordm;F (35&ordm;C).",
"     </p>",
"     <p>",
"      Hypothermia can happen after being in cold air or water for too long. Young children and elderly people are more likely to get hypothermia.",
"     </p>",
"     <p>",
"      Hypothermia can cause serious problems, or even death, if it is not treated quickly.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H175117924\">",
"      <span class=\"h1\">",
"       What are the symptoms of hypothermia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms can include (",
"      <a class=\"graphic graphic_table graphicRef83975 \" href=\"UTD.htm?20/59/21435\">",
"       table 1",
"      </a>",
"      ):",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Shivering (but if hypothermia becomes severe, the person might actually",
"        <strong>",
"         stop",
"        </strong>",
"        shivering)",
"       </li>",
"       <li>",
"        Clumsiness",
"       </li>",
"       <li>",
"        Trouble speaking clearly",
"       </li>",
"       <li>",
"        Confusion",
"       </li>",
"       <li>",
"        Feeling tired",
"       </li>",
"       <li>",
"        Breathing faster than usual",
"       </li>",
"       <li>",
"        Urinating more than usual",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Because hypothermia can happen slowly and cause confusion, a person might not realize that he or she has it.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H175117939\">",
"      <span class=\"h1\">",
"       How can I help a person who might have hypothermia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you think someone might be in danger of hypothermia, you should:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Move the person to a warmer place as soon as possible",
"       </li>",
"       <li>",
"        Take off any wet clothing",
"       </li>",
"       <li>",
"        Cover the person with blankets",
"       </li>",
"       <li>",
"        Offer warm beverages if the person is able to drink",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you think you or another person might have frostbite (damage to a body part caused by cold), do",
"      <strong>",
"       not",
"      </strong>",
"      rub or massage the affected skin. This can cause worse damage.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H175117954\">",
"      <span class=\"h1\">",
"       When should I call for help?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If a person shows signs of moderate or severe hypothermia, get medical care right away. Signs include passing out, trouble speaking or thinking clearly, clumsiness, loss of shivering, and trouble breathing. Waiting to get treatment could cause serious health problems or even death.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H175117969\">",
"      <span class=\"h1\">",
"       How is hypothermia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It depends on how serious it is. In many cases, getting out of the cold and warming up with blankets can prevent the need for medical care.",
"     </p>",
"     <p>",
"      Severe hypothermia needs to be treated in the hospital. Doctors will check the person&rsquo;s temperature. They will also try to make sure the person keeps breathing and that his or her heart keeps beating.",
"     </p>",
"     <p>",
"      Hospital treatment of hypothermia might include any of the following:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blankets, heating pads, warm baths, or heaters that blow warm air &ndash; These can all be used to help bring a person&rsquo;s body temperature back up.",
"       </li>",
"       <li>",
"        Warm fluids through IV (a thin tube that goes into a vein)",
"       </li>",
"       <li>",
"        Warm oxygen to breathe, or a breathing tube if needed",
"       </li>",
"       <li>",
"        Warming the inside of the body with water &ndash; Warm salt water can be used to bring heat to the organs. The water goes into the body through a small tube, then back out.",
"       </li>",
"       <li>",
"        Medicines &ndash; Sometimes medicines are needed to treat related issues like low blood pressure or heart problems.",
"       </li>",
"       <li>",
"        Blood rewarming &ndash; This is done with a special machine that draws blood out of the body, warms it up, and then puts it back in.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H175117984\">",
"      <span class=\"h1\">",
"       Can hypothermia be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. In most cases, you can prevent hypothermia by being careful not to stay out in the cold for too long. Be sure to dress warmly enough, and wear layers. Change out of wet clothes as quickly as possible.",
"     </p>",
"     <p>",
"      Babies and young children are more likely than adults to get hypothermia. That&rsquo;s because their bodies have a harder time keeping warm, and they might not always notice when they are getting too cold. Make sure that children are dressed warmly and wear hats and mittens in cold weather. Don&rsquo;t let them play outside in the cold for too long without taking a break to warm up.",
"     </p>",
"     <p>",
"      Elderly people also have a harder time than younger adults keeping warm, and they are more likely to have health issues or take medicines that can affect body temperature. You can help older people by making sure that their homes are kept warm enough, especially in winter.",
"     </p>",
"     <p>",
"      People who have problems with alcohol also have a higher risk of getting hypothermia. That&rsquo;s because alcohol can make it harder to notice when your body is getting too cold. Drinking too much can also cause you to pass out, which can lead to hypothermia in cold weather. If you think you or someone you know might have a drinking problem, talk to a doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H336862244\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
