" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Evaluation and management of neonatal Graves' disease",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
